
var crypto = require('crypto');


var b = new Buffer('Questa è la frase da criptare','utf8');
var msg = [];
var txtMsg = ""


var cipher = crypto.createCipher('aes192',"secret1234");
var deipher = crypto.createDecipher('aes192',"secret1234");

msg.push(cipher.update(b,'utf8','hex'));
msg.push(cipher.final('hex'));

var cipherMsg = msg.join("");
console.log('cipherMsg: ',cipherMsg);
//b = new Buffer(cipherMsg,'hex');
b = new Buffer('','hex');

msg = [];
txtMsg += deipher.update(b,'hex','utf8');
txtMsg += deipher.final('utf8');

